import React, { useEffect, useState, useContext } from 'react';
import '../../Style.css';
import { Box, Typography, Button, Modal, TextField } from '@mui/material';
import axios from 'axios';
import { AuthContext } from '../../context/AuthContext';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: '100%',
  height: '100%',
  backgroundColor: 'white',
};

function SettingsTowerCrane() {
  const [craneAssets, setCraneAssets] = useState([]);
  const {userToken} = useContext(AuthContext);

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  useEffect(() => {
    console.log(userToken);
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${userToken}`,
    };
    try {
      axios.get('http://127.0.0.1:8000/api/assets/crane', {
        headers: headers
      })
      .then((res) => {
        setCraneAssets(res.data.data);
      })
    } catch(e) {
      console.log(e);
    }
  })

  return (
    <>
      <Box sx={{
          position: 'relative', 
          width: 415,
          maxWidth: 415,
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
      >
        <Box display="flex" sx={{
          height: 65,
          borderBottom: 2,
          borderColor: '#edf2f6',
          padding: '3px'
        }}>
          <Box sx={{width: '65px', height: '65px', backgroundColor: 'red'}}>

          </Box>
          <TextField sx={{width: '100%'}}></TextField>
        </Box>
        <Box display="flex" sx={{
          height: 'calc(100% - 65)',
        }}>
          <Box sx={{
            display: 'flex',
          }}>
            <Box sx={{flexDirection: 'column', width: 415}}>
              {
                craneAssets.map((craneAssets) => (
                  <Box display="flex" alignItems="center" justifyContent="space-between" sx={{minHeight: 100, padding: '0px 45px', borderBottom: 2, borderBottomColor: '#edf2f6'}}>
                    <h1>{craneAssets.custom_name}</h1>
                  </Box>
                ))
              }
            </Box>
            <Box display="flex" justifyContent="center" alignItems="center" sx={{position: 'fixed', bottom: 0, height: 100, width: 415, padding: '15px 20px', borderTop: 2, borderTopColor: '#edf2f6'}}>
              <Button variant='contained' sx={{width: '100%', height: '100%', backgroundColor: '#0f72bd'}} onClick={() => handleOpen()}>Add Crane</Button>
            </Box>
          </Box>
        </Box>
      </Box>
      <Modal
        open={open}
      >
        <Box sx={style}>
          <Box sx={{display: 'flex', width: '100%', height: '75px', justifyContent: 'flex-end', padding: '10px', borderWidth: 5}}>
              <Button variant='contained' onClick={() => handleClose()}>Close Modal</Button>
          </Box>
          <Box sx={{display: 'flex', margin: '50px 20px', alignItems: 'center', flexDirection: 'column'}}>
              <Typography>Add Crane</Typography>
              <Box>
                <Typography>Name</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box>
                <Typography>Crane Type</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box>
                <Typography>Crane Manufacturer</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box>
                <Typography>Model</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box sx={{display: 'flex', marginTop: '50px', flexDirection: 'column'}}>
                <Box sx={{marginTop: '10px'}}>
                  <Button variant='contained' sx={{width: '360px', height: '75px'}}>Add</Button>
                </Box>
                <Box sx={{marginTop: '10px'}}>
                  <Button variant='contained' sx={{width: '360px', height: '75px'}} onClick={() => handleClose()}>Cancel</Button>
                </Box>
              </Box>
          </Box>
        </Box>
      </Modal>
    </>
  );
}

export default SettingsTowerCrane;
